import React from 'react';
import css from './Users.module.css';

const Users = (props) => {
    return (
        <div className={css.test}>
            <ul>
                {
                    props.users.map(u => {
                        return (
                            <li>
                                <div>{u.name}</div>
                                <div>{u.location.city + '' + u.location.country}</div>
                                <div>{u.status}</div>
                            </li>
                        )
                    })
                }
            </ul>
        </div>
    )
}

export default Users;
